def solve_dp(plans, K, P):
    from collections import defaultdict

    # Initialize DP with the starting state (0, 0, ..., 0)
    dp = {(0,)*K: 0}

    for plan in plans:
        plan_cost = plan[-1]
        plan_increments = plan[:-1]
        temp_dp = dp.copy()

        for state in dp:
            current_cost = dp[state]
            new_state = tuple(min(state[i] + plan_increments[i], P) for i in range(K))
            new_cost = current_cost + plan_cost

            if new_state not in temp_dp or new_cost < temp_dp[new_state]:
                temp_dp[new_state] = new_cost

        dp = temp_dp

    # Find the minimum cost to reach the target state (e.g., (P, P, ..., P))
    target_state = tuple([P]*K)
    return dp.get(target_state, float('inf'))

