def can_form_array(nums, k):
    n = len(nums)
    ops = [0] * n  # To store the value of each operation
    window_sum = 0

    for i in range(n):
        if i >= k:
            window_sum -= ops[i - k]
        remaining = nums[i] - window_sum
        if remaining < 0:
            return False
        if i > n - k:
            if remaining > 0:
                return False
        else:
            ops[i] = remaining
            window_sum += ops[i]

    return True

